def invertPST (pst):
    invertedPST = [0]*64
    for i in range(64):
        invertedPST[63-i] = pst[i]
    return invertedPST


def convertPSTToDictionary(pst: list):
    dictionary = {}
    square = 1 << 63
    for i in range(len(pst)):
        dictionary[square] = pst[i]
        square >>= 1
    return dictionary

